const JsonApi = () => {
  let [api, setApi] = useState();
  useEffect(() => {
    fetch("https://jsonplaceholder.org/users")
      .then((data) => data.json())
      .then((elem) => setApi(elem));
  });
  return (
    <div>
      <div>json</div>
    </div>
  );
};

export default JsonApi;
